import { Component } from "react"
import "./PageName.css"

class PageName extends Component{

    name = "Login"
    constructor(name:string)
    {
        super({name})
        this.name = name
    }
    render() {
    return <span className="page-tile">
        Login
    </span>
}
}

export default PageName
